/**
 * ðŸŽ¯ Real-Time Pose Analyzer Component
 * à¹à¸ªà¸”à¸‡à¸à¸²à¸£à¸§à¸´à¹€à¸„à¸£à¸²à¸°à¸«à¹Œà¸—à¹ˆà¸²à¸—à¸²à¸‡à¹à¸šà¸šà¹€à¸£à¸µà¸¢à¸¥à¹„à¸—à¸¡à¹Œà¸žà¸£à¹‰à¸­à¸¡ UI à¸—à¸µà¹ˆà¸ªà¸§à¸¢à¸‡à¸²à¸¡
 */

import React from 'react';
import { poseComparator } from '../utils/PoseComparator';
import './RealTimePoseAnalyzer.css';

const RealTimePoseAnalyzer = ({ 
  matchScore, 
  feedback, 
  bodyPartScores, 
  detailedAnalysis, 
  confidenceLevel,
  isActive = true 
}) => {
  
  // à¸ªà¸£à¹‰à¸²à¸‡ gradient à¸ªà¸³à¸«à¸£à¸±à¸š accuracy bar
  const getAccuracyGradient = (score) => {
    if (score >= 85) return 'linear-gradient(180deg, #22c55e 0%, #16a34a 100%)';
    if (score >= 70) return 'linear-gradient(180deg, #eab308 0%, #ca8a04 100%)';
    if (score >= 50) return 'linear-gradient(180deg, #f97316 0%, #ea580c 100%)';
    return 'linear-gradient(180deg, #ef4444 0%, #dc2626 100%)';
  };

  const getScoreEmoji = (score) => {
    if (score >= 90) return 'ðŸŽ‰';
    if (score >= 80) return 'ðŸ‘';
    if (score >= 70) return 'âš¡';
    if (score >= 60) return 'âš ï¸';
    if (score >= 40) return 'ðŸ”„';
    return 'ðŸŽ¯';
  };

  return (
    <div className={`pose-analyzer ${isActive ? 'active' : 'inactive'}`}>
      {/* Main Accuracy Display */}
      <div className="accuracy-display">
        <div className="accuracy-header">
          <span className="accuracy-emoji">{getScoreEmoji(matchScore)}</span>
          <div className="accuracy-label">Accuracy</div>
        </div>
        
        <div className="accuracy-bar-wrapper">
          <div className="accuracy-bar-main">
            <div 
              className="accuracy-fill-main" 
              style={{ 
                height: `${matchScore}%`,
                background: getAccuracyGradient(matchScore)
              }}
            >
              <div className="accuracy-shimmer"></div>
            </div>
          </div>
          
          <div className="accuracy-percentage-main">
            {matchScore}%
          </div>
        </div>
        
        {confidenceLevel > 0 && (
          <div className="confidence-display">
            <div className="confidence-bar">
              <div 
                className="confidence-fill"
                style={{ width: `${confidenceLevel}%` }}
              ></div>
            </div>
            <span className="confidence-text">Confidence: {confidenceLevel}%</span>
          </div>
        )}
      </div>

      {/* Body Parts Analysis */}
      {Object.keys(bodyPartScores).length > 0 && (
        <div className="body-parts-analysis">
          <div className="analysis-header">
            <span className="analysis-icon">ðŸŽ¯</span>
            <span className="analysis-title">Body Parts</span>
          </div>
          
          <div className="body-parts-grid">
            {Object.entries(bodyPartScores)
              .sort(([,a], [,b]) => b - a) // Sort by score (highest first)
              .slice(0, 6) // Show top 6 body parts
              .map(([part, score]) => (
                <div key={part} className="body-part-item">
                  <div className="body-part-header">
                    <span className="body-part-name">
                      {poseComparator.getBodyPartNameThai(part)}
                    </span>
                    <span className="body-part-score">
                      {Math.round(score)}%
                    </span>
                  </div>
                  
                  <div className="body-part-bar">
                    <div 
                      className="body-part-fill"
                      style={{ 
                        width: `${score}%`,
                        backgroundColor: poseComparator.getAccuracyColor(score)
                      }}
                    ></div>
                  </div>
                </div>
              ))
            }
          </div>
        </div>
      )}

      {/* Real-time Feedback */}
      <div className="feedback-section">
        <div className="feedback-bubble">
          <div className="feedback-content">
            {feedback}
          </div>
        </div>

        {/* Quick Tips */}
        {detailedAnalysis?.recommendations && detailedAnalysis.recommendations.length > 0 && (
          <div className="quick-tips">
            <div className="tips-header">
              <span className="tips-icon">ðŸ’¡</span>
              <span className="tips-title">Quick Tips</span>
            </div>
            
            <div className="tips-list">
              {detailedAnalysis.recommendations.slice(0, 2).map((rec, index) => (
                <div key={index} className="tip-item">
                  <span className="tip-dot">â€¢</span>
                  <span className="tip-text">{rec.suggestion}</span>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>

      {/* Session Stats */}
      {detailedAnalysis && (
        <div className="session-stats">
          <div className="stats-grid">
            <div className="stat-item">
              <div className="stat-value">{detailedAnalysis.totalKeypoints}</div>
              <div className="stat-label">Total Points</div>
            </div>
            
            <div className="stat-item">
              <div className="stat-value">
                {detailedAnalysis.visibleKeypoints?.trainee || 0}
              </div>
              <div className="stat-label">Visible</div>
            </div>
            
            <div className="stat-item">
              <div className="stat-value">
                {Object.keys(bodyPartScores).length}
              </div>
              <div className="stat-label">Body Parts</div>
            </div>
          </div>
        </div>
      )}

      {/* Status Indicator */}
      <div className={`status-indicator ${isActive ? 'analyzing' : 'idle'}`}>
        <div className="status-dot"></div>
        <span className="status-text">
          {isActive ? 'Analyzing...' : 'Waiting for pose'}
        </span>
      </div>
    </div>
  );
};

export default RealTimePoseAnalyzer;
